@bindersout_ is a grassroots program formed in 2016 to give trans and non-binary folks access to affordable and safe chest-binding garments. We collect pre-loved binders from the community and make them available for those in need. ALL our Binders are pay what you can!!

This small but mighty non-profit is run entirely through volunteer work, and funded entirely through donations. Every pre-loved binder we receive, and every Binder we purchase with funds from our PWYC payments, donations, and community fundraising; gives the gift of gender euphoria, and helps a trans person thrive.

Do you have a Binder to donate? Want to make a financial donation to support our @bindersout_ Binder Fund? We're fundraising for our next order of binders from @gc2b + to help sustain our mailing program, sending PWYC/Free Binders to Trans folx across Canada and beyond! 
Links to donate through Paypal, #GoFundMe, and #Patreon can be found in @bindersout_'s linktree (link in their profile), as well as our Binder Donation + Binder Request forms!

