ook at myself. I was raised hispanic. I wasn‚Äôt able to talk about it. Growing up working class, experiencing racial inequity, then as a single parent with a child to pay for - there is no way for me to get ahead. You start to lose hope.‚ÄùAccording to The Trans Law Center: ‚ÄúThe COVID-19 pandemic, the federal government‚Äôs failed response, and public panic all harm trans people in uniquely stressful and isolating ways.‚ÄØThe federal government‚ÄØhas‚ÄØfailed to address the severity of this moment or protect those already made vulnerable by systemic discrimination and violence‚Ä¶‚Äù

Lorenzo is proud. He doesn‚Äôt want your sympathy. He wants to share his story. He wants to build BI-POC LGBTQIA community. He wants to be a youth pastor one day and help kids like him through the power of prayer. His faith has never wavered through his adversities. His willpower is being challenged these days. As a trans person of color living in rural Texas with minimal benefits, he has almost zero access to resources. He needs your support. While cost estimates vary widely, the Philadelphia Center for Transgender Surgery estimates that "bottom surgery" costs about $24,900 for female-to-male transitions. (Continued in comments...)";}i:238;a:1:{s:14:"comments_count";i:2;}i:239;a:1:{s:11:"likes_count";i:4;}i:240;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu-T6lhtQf";}i:241;a:1:{s:5:"image";s:238:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118801878_167721344854894_8401790655549472863_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=110&_nc_ohc=pmQvz93WuRcAX_AXMRd&oh=7236585e8e606b8877e90509b622bc6b&oe=5F7C74F2";}i:242;a:1:{s:4:"type";s:5:"image";}i:243;a:1:{s:8:"owner_id";i:18511926548;}i:244;a:1:{s:14:"owner_username";s:0:"";}i:245;a:1:{s:14:"owner_fullname";s:0:"";}i:246;a:1:{s:9:"owner_pic";s:0:"";}i:247;a:1:{s:2:"id";s:19:"2391122043166160683";}i:248;a:1:{s:10:"short_code";s:11:"CEu-NRdhncr";}i:249;a:1:{s:12:"created_time";i:1599264035;}i:250;a:1:{s:7:"caption";s:444:"Tip. These. Men. ü§©üåà‚ú®
